var t=Ember.HTMLBars.template({id:"WePl+/1n",block:'[[[10,"h3"],[12],[1,"Tasks on Ember.Route (and other long-lived objects)"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  "],[10,"strong"],[12],[1,"ember-concurrency"],[13],[1," tasks are scoped to the lifetime of\\n  the object they live on, so if that object is destroyed, all of the\\n  tasks attached to it are canceled.  This is very convenient when\\n  writing tasks on object with finite lifetimes, like Components, but certain Ember objects, like\\n  Routes (and Controllers), are never actually destroyed. Even\\n  if you can\'t rely on object destruction to cancel a task,\\n  "],[10,"strong"],[12],[1,"ember-concurrency"],[13],[1," makes it easy to run\\n  tasks between lifecycle events other than "],[10,"code"],[12],[1,"init"],[13],[1,"\\n  and "],[10,"code"],[12],[1,"destroy"],[13],[1,".\\n"],[13],[1,"\\n\\n"],[10,"h3"],[12],[1,"Live Example"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Try clicking the links below. As the URL changes, you should see\\n  notifications about the server polling status changing. If you\\n  leave this route (by going to another page on this site), you\'ll\\n  see that the polling task is being properly canceled.\\n"],[13],[1,"\\n\\n"],[10,"ul"],[12],[1,"\\n"],[42,[28,[37,1],[[28,[37,1],[[30,0,["ids"]]],null]],null],null,[[[1,"    "],[10,"li"],[12],[1,"\\n      "],[8,[39,2],null,[["@route","@model"],["docs.examples.route-tasks.detail",[30,1]]],[["default"],[[[[1,"\\n        Thing "],[1,[30,1]],[1,"\\n      "]],[]]]]],[1,"\\n    "],[13],[1,"\\n"]],[1]],null],[13],[1,"\\n\\n"],[10,"ul"],[12],[1,"\\n  "],[10,"li"],[12],[1,"\\n    We use the "],[10,3],[14,6,"https://github.com/aexmachina/ember-notify"],[12],[1,"ember-notify"],[13],[1," Ember Addon\\n    to display notifications using the "],[10,"code"],[12],[1,"notify"],[13],[1," service it provides.\\n  "],[13],[1,"\\n  "],[10,"li"],[12],[1,"\\n    "],[10,"code"],[12],[1,"setupController"],[13],[1," kicks off the task with the current model id\\n  "],[13],[1,"\\n  "],[10,"li"],[12],[1,"\\n    The "],[10,"code"],[12],[1,"pollServerForChanges"],[13],[1," task polls the server in a loop,\\n    and uses the "],[10,"code"],[12],[1,"finally"],[13],[1," block to notify when it is being canceled.\\n  "],[13],[1,"\\n  "],[10,"li"],[12],[1,"\\n    We use "],[10,"code"],[12],[1,"restartable"],[13],[1," to ensure that only one instance of the\\n    task is running at a time, hence any time "],[10,"code"],[12],[1,"setupController"],[13],[1,"\\n    performs the task, any prior instances are canceled.\\n  "],[13],[1,"\\n  "],[10,"li"],[12],[1,"\\n    We use "],[10,"code"],[12],[1,"cancelAll"],[13],[1," in the route\'s "],[10,"code"],[12],[1,"resetController"],[13],[1,"\\n    hook to make sure the task cancels when the user leaves the route.\\n  "],[13],[1,"\\n"],[13],[1,"\\n\\n"],[8,[39,3],null,[["@name"],["detail-route.js"]],null],[1,"\\n"]],["id"],false,["each","-track-array","link-to","code-snippet"]]',moduleName:"dummy/docs/examples/route-tasks/template.hbs",isStrictMode:!1})
