var t=Ember.HTMLBars.template({id:"JkZ7aJRD",block:'[[[10,"h3"],[12],[1,"Managing Task Concurrency"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  By default, "],[10,"strong"],[12],[1,"ember-concurrency"],[13],[1," tasks run concurrently\\n   if you call "],[10,"code"],[12],[1,"myTask.perform(); myTask.perform();"],[13],[1,",\\n  two instances of the task will run at the same time (unless the object\\n  they live on is destroyed, in which case they\'ll be canceled).\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Often, you want to guarantee that no more than one instance of a task\\n  runs at the same time; for instance, if you have a task that saves\\n  model state to the server, you probably don\'t want that task to run\\n  concurrently  you want it to run sequentially, or you might\\n  want to ignore attempts to perform the task if it\'s already running.\\n  Manually enforcing these constraints is tricky and often results\\n  in redundant, error-prone boilerplate, but ember-concurrency\\n  makes it easy to rein in this undesired concurrency with the\\n  modifiers described below.\\n"],[13],[1,"\\n\\n"],[10,"h3"],[14,1,"examples"],[12],[1,"Examples"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  All of the examples below run the same task function (which\\n  just pauses for a moment and then completes), but with\\n  different task modifiers applied:\\n"],[13],[1,"\\n\\n"],[8,[39,0],null,[["@name"],["shared-tasks.js"]],null],[1,"\\n\\n"],[10,"h5"],[14,1,"default"],[12],[1,"Default Behavior: Tasks Run Concurrently"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Tap the "],[10,"code"],[12],[1,"task.perform()"],[13],[1," button a few times. Note how\\n  the lifetimes of each task overlap, and each task runs to completion.\\n"],[13],[1,"\\n\\n"],[8,[39,1],null,[["@task"],[[30,0,["defaultTask"]]]],null],[1,"\\n\\n\\n"],[10,"h4"],[14,1,"restartable"],[12],[1,"restartable"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  The "],[10,"code"],[12],[1,"restartable"],[13],[1," modifier ensures that only one instance\\n  of a task is running by canceling any currently-running tasks and starting\\n  a new task instance immediately. Note how there is no task overlap,\\n  and how currently running tasks get canceled\\n  if a new task starts before a prior one completes.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  "],[10,"em"],[12],[1,"\\n    Check out "],[8,[39,2],null,[["@route"],["docs.examples.autocomplete"]],[["default"],[[[[1,"Debounced Auto-Search"]],[]]]]],[1," for\\n    a practical example of restartable\\n  "],[13],[1,"\\n"],[13],[1,"\\n\\n\\n"],[8,[39,1],null,[["@task"],[[30,0,["restartableTask"]]]],null],[1,"\\n\\n"],[10,"h4"],[14,1,"enqueue"],[12],[1,"enqueue"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  The "],[10,"code"],[12],[1,"enqueue"],[13],[1," modifier ensures that only one instance\\n  of a task is running by maintaining a queue of pending tasks and\\n  running them sequentially. Note how there is no task overlap, but no\\n  tasks are canceled either.\\n"],[13],[1,"\\n\\n"],[8,[39,1],null,[["@task"],[[30,0,["enqueuedTask"]]]],null],[1,"\\n\\n\\n"],[10,"h4"],[14,1,"drop"],[12],[1,"drop"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  The "],[10,"code"],[12],[1,"drop"],[13],[1," modifier drops tasks that are "],[10,"code"],[12],[1,".perform()"],[13],[1,"ed\\n  while another is already running. Dropped tasks\' functions are never even called.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  "],[10,"em"],[12],[1,"\\n    Check out the "],[8,[39,2],null,[["@route"],["docs.examples.loading-ui"]],[["default"],[[[[1,"Loading UI"]],[]]]]],[1," example for a common\\n    use case for "],[10,"code"],[12],[1,"drop"],[13],[1,"\\n  "],[13],[1,"\\n"],[13],[1,"\\n\\n"],[8,[39,1],null,[["@task"],[[30,0,["droppingTask"]]]],null],[1,"\\n\\n\\n"],[10,"h4"],[14,1,"keepLatest"],[12],[1,"keepLatest"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  The "],[10,"code"],[12],[1,"keepLatest"],[13],[1," will drop all but the most recent intermediate "],[10,"code"],[12],[1,".perform()"],[13],[1,",\\n  which is enqueued to run later.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  "],[10,"em"],[12],[1,"\\n    Use case: you poll the server in a loop, but during the server request,\\n    you get some other indication (say, via websockets) that the data is stale\\n    and you need to query the server again when the initial request completed.\\n  "],[13],[1,"\\n"],[13],[1,"\\n\\n"],[8,[39,1],null,[["@task"],[[30,0,["keepLatestTask"]]]],null],[1,"\\n"]],[],false,["code-snippet","concurrency-graph","link-to"]]',moduleName:"dummy/docs/task-concurrency/template.hbs",isStrictMode:!1})
