var t=Ember.HTMLBars.template({id:"AntY9nPU",block:'[[[10,"h3"],[12],[1,"Task lifecycle events"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  ember-concurrency implements a number of lifecycle events that allow\\n  for a host object to react to various changes in task instance lifecycle.\\n  Using lifecycle hooks allows for adding things like instrumentation to tasks\\n  or for separating and reusing error handling code across different tasks.\\n  Using the "],[10,"code"],[12],[1,"evented"],[13],[1," modifier will enable tasks to fire lifecycle\\n  events on their host objects.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  In the below example, we refactor the\\n  "],[8,[39,0],null,[["@route"],["docs.examples.ajax-throttling"]],[["default"],[[[[1,"AJAX throttling example"]],[]]]]],[1," to use\\n  task events for logging of the "],[10,"code"],[12],[1,"ajaxTask"],[13],[1,"\'s state changes, instead\\n  of doing it manually in the looping task itself.\\n"],[13],[1,"\\n\\n"],[10,"h3"],[12],[1,"Live Example"],[13],[1,"\\n\\n"],[8,[39,1],null,null,null],[1,"\\n\\n"],[8,[39,2],null,[["@name"],["task-lifecycle-events.js"]],null],[1,"\\n"]],[],false,["link-to","task-lifecycle-events-example","code-snippet"]]',moduleName:"dummy/docs/task-lifecycle-events/template.hbs",isStrictMode:!1})
